effective and fulfilling way.</li>\r\n</ul>\r\n</div>','About Us','','publish','open','open','','about-us','','','2015-09-17 08:32:22','2015-09-17 08:32:22','',0,'http://cmabhavsarassoc.in/?page_id=2',0,'page','',0),(4,1,'2015-07-16 10:10:10','2015-07-16 10:10:10','','Home','','publish','open','open','','home','','','2015-09-17 08:33:30','2015-09-17 08:33:30','',0,'http://cmabhavsarassoc.in/?p=4',1,'nav_menu_item','',0),(6,1,'2015-07-16 10:10:17','2015-07-16 10:10:17','This is an example page. It\'s different from a blog post because it will stay in one place and will show up in your site navigation (in most themes). Most people start with an About page that introduces them to potential site visitors. It might say something like this:\n\n<blockquote>Hi there! I\'m a bike messenger by day, aspiring actor by night, and this is my blog. I live in Los Angeles, have a great dog named Jack, and I like pi&#241;a coladas. (And gettin\' caught in the rain.)</blockquote>\n\n...or something like this:\n\n<blockquote>The XYZ Doohickey Company was founded in 1971, and has been providing quality doohickeys to the public ever since. Located in Gotham City, XYZ employs over 2,000 people and does all kinds of awesome things for the Gotham community.</blockquote>\n\nAs a new WordPress user, you should go to <a href=\"http://cmabhavsarassoc.in/wp-admin/\">your dashboard</a> to delete this page and create new pages for your content. Have fun!','Sample Page','','inherit','open','open','','2-revision-v1','','','2015-07-16 10:10:17','2015-07-16 10:10:17','',2,'http://cmabhavsarassoc.in/2015/07/16/2-revision-v1/',0,'revision','',0),(7,1,'2015-07-16 10:10:35','2015-07-16 10:10:35','This is an example page. It\'s different from a blog post because it will stay in one place and will show up in your site navigation (in most themes). Most people start with an About page that introduces them to potential site visitors. It might say something like this:\r\n<blockquote>Hi there! I\'m a bike messenger by day, aspiring actor by night, and this is my blog. I live in Los Angeles, have a great dog named Jack, and I like pia coladas. (And gettin\' caught in the rain.)</blockquote>\r\n...or something like this:\r\n<blockquote>The XYZ Doohickey Company was founded in 1971, and has been providing quality doohickeys to the public ever since. Located in Gotham City, XYZ employs over 2,000 people and does all kinds of awesome things for the Gotham community.</blockquote>\r\nAs a new WordPress user, you should go to <a href=\"http://cmabhavsarassoc.in/wp-admin/\">your dashboard</a> to delete this page and create new pages for your content. Have fun!','About Us','','inherit','open','open','','2-revision-v1','','','2015-07-16 10:10:35','2015-07-16 10:10:35','',2,'http://cmabhavsarassoc.in/2015/07/16/2-revision-v1/',0,'revision','',0),(8,1,'2015-07-16 10:10:52','2015-07-16 10:10:52','<div class=\"service-container\">\r\n	<div class=\"service-box-1\"> <img src=\"http://cmabhavsarassoc.in/wp-content/themes/twentytwelve/img/service-img-1.jpg\" alt=\"\" />\r\n    <h1>Statutory Services</h1>\r\n    <div class=\"service-point\">\r\n      <ul>\r\n        <li>Preparation of Cost Accounting Records u/s 148 (1) of The Companies Act, 2013.</li>\r\n        <li>Conducting Cost Audit u/s 148 (2) of The Companies Act, 2013.</li>\r\n        <li>Prepare CAS 4 (Captive consumption certificate) for submission to Excise Department Requirement</li>\r\n        <li>All type of certification work that can be certified by the practicing CMA.</li>\r\n      </ul>\r\n    </div>\r\n  </div>  \r\n	<div class=\"service-box-2\"> <img src=\"http://cmabhavsarassoc.in/wp-content/themes/twentytwelve/img/service-img-2.jpg\" alt=\"\" />\r\n    <h1>Cost and Management Services</h1>\r\n    <div class=\"service-point\">\r\n      <ul>\r\n        <li>Product wise annual, monthly as well as daily costing system</li>\r\n        <li>Department wise annual, monthly as well as daily costing system</li>\r\n        <li>Variance Analysis</li>\r\n        <li>Cost Control System</li>\r\n        <li>Cost Reduction</li>\r\n        <li>Profitability Analysis</li>\r\n        <li>Decision Making</li>\r\n        <li>Profitability Analysis</li>\r\n        <li>Preparing Different types of MIS as a consultant.</li>\r\n        <li>Out Sourcing of the costing department as per the requirement of client.</li>\r\n      </ul>\r\n    </div>\r\n  </div>  \r\n	<div class=\"service-box-3\"> <img src=\"http://cmabhavsarassoc.in/wp-content/themes/twentytwelve/img/service-img-3.jpg\" alt=\"\" />\r\n    <h1>Other Value Added Services</h1>\r\n    <div class=\"service-point\">\r\n      <ul>\r\n        <li>Internal Audit</li>\r\n        <li>Physical Verification of Inventory &amp; Valuation of Inventory</li>\r\n        <li>Physical Verification of Fixed Assets &amp; preparation of Fixed Assets Register</li>\r\n        <li>Project Finance</li>\r\n        <li>Formation of company as per the Companies Act, 2013 and other related work</li>\r\n        <li>Direct and Indirect Tax consultancy</li>\r\n        <li>Maintains of Accounts under various accounting software</li>\r\n        <li>Out Sourcing of Accounting department as per the requirement of client</li>\r\n        <li>Anti Dumping consultancy</li>\r\n      </ul>\r\n    </div>\r\n  </div>\r\n	<div class=\"service-box-2\"> <img src=\"http://cmabhavsarassoc.in/wp-content/uploads/2015/07/Logo-300x103.png\" width=\"344\" height=\"197\" alt=\"\" />\r\n    <h1>GST Services</h1>\r\n    <div class=\"service-point\">\r\n      <ul>\r\n        <li style=\"text-align: justify;\">Implementation to GST</li>\r\n      </ul>\r\n      <ol>\r\n        <li style=\"text-align: left;\">Changes in Accounting System</li>\r\n        <li style=\"text-align: left;\">Changes in procurement process</li>\r\n        <li style=\"text-align: left;\">Supply Chain Management</li>\r\n        <li style=\"text-align: left;\">Strategic Business decision under GST Area</li>\r\n        <li style=\"text-align: left;\">System Design for seamless compliance and return filling under GST</li>\r\n      </ol>\r\n      <ul>\r\n        <li>Other service related to GST Migration, Registration, Return filling, Accounting etc.</li>\r\n        <li>Various Certification under GST</li>\r\n        <li>Audit under GST</li>\r\n        <li>Tax assessment under GST Laws</li>\r\n        <li>Business advisory services</li>\r\n      </ul>\r\n    </div>\r\n  </div>\r\n</div>','Services','','publish','open','open','','services','','','2017-06-01 08:08:07','2017-06-01 08:08:07','',0,'http://cmabhavsarassoc.in/?page_id=8',0,'page','',0),(9,1,'2015-07-16 10:10:52','2015-07-16 10:10:52','This is an example page. It\'s different from a blog post because it will stay in one place and will show up in your site navigation (in most themes). Most people start with an About page that introduces them to potential site visitors. It might say something like this:\r\n<blockquote>Hi there! I\'m a bike messenger by day, aspiring actor by night, and this is my blog. I live in Los Angeles, have a great dog named Jack, and I like pia coladas. (And gettin\' caught in the rain.)</blockquote>\r\n...or something like this:\r\n<blockquote>The XYZ Doohickey Company was founded in 1971, and has been providing quality doohickeys to the public ever since. Located in Gotham City, XYZ employs over 2,000 people and does all kinds of awesome things for the Gotham community.</blockquote>\r\nAs a new WordPress user, you should go to <a href=\"http://cmabhavsarassoc.in/wp-admin/\">your dashboard</a> to delete this page and create new pages for your content. Have fun!','Services','','inherit','open','open','','8-revision-v1','','','2015-07-16 10:10:52','2015-07-16 10:10:52','',8,'http://cmabhavsarassoc.in/2015/07/16/8-revision-v1/',0,'revision','',0),(10,1,'2015-07-16 10:11:02','2015-07-16 10:11:02','<div class=\"industry-container\">\r\n    	<div class=\"industry-box-1\">\r\n        	<img src=\"http://cmabhavsarassoc.in/wp-content/themes/twentytwelve/img/industry-img-2.jpg\" />\r\n            <h1>Industrial Sector</h1>\r\n            <div class=\"industry-point\">\r\n            	<ul>\r\n<li>Textile, Terry Towel, Man Made Fiber, Filament and Denim (Composite Units, Process Houses, Denims, Draw Twisting Units, Texturizing Units, POY Plants)</li>\r\n<li>Engineering Products (Machine Shop, Fabrication, Electrical and Assembly oriented), Bearings, Monoblock Pumps, Monoset Pumps, Submersible pumps, Induction Furnaces, Diesel Engines, Barge, Tug Boats, Air Conditioners, VC Coolers Auto Component Parts etc.</li>\r\n<li>Foundry and Steel (Heavy and Precision Castings, Grinding Media, Steel Plant, Rolling Mill, Forging Unit, Bright Bar Unit)</li>\r\n<li>Lighting Industry (Lighting Bulbs, Tube Lights, Sodium Lamps, Mercury Lamps, Caps, Filaments, and Glass Sheet etc. Components)</li>\r\n<li>Heavy Commercial Vehicles</li>\r\n<li>Gas Cylinder for various uses</li>\r\n<li>Rubber (Vehicle Tubes)</li>\r\n<li>Tubes and Pipes (Steel Tubes, Precision Tubes, Copper Plated Aluminum Tubes)</li>\r\n<li>Chemicals (Caustic Soda, Detergents, Dyes & Intermediates, Agro Chemicals (Pesticides), Toilet Soap, Ethylene Acetate, Alcohol, Sulphuric Acid, Vinyl Sulphone etc.)</li>\r\n<li>Vegetable Oil Product</li>\r\n<li>Ice Cream</li>\r\n<li>Publication & Stationery items</li>\r\n                </ul>\r\n            </div>\r\n        </div>\r\n        \r\n        <div class=\"industry-box-2\">\r\n        	<img src=\"http://cmabhavsarassoc.in/wp-content/themes/twentytwelve/img/industry-img-1.jpg\" />\r\n            <h1>Service Sector</h1>\r\n            <div class=\"industry-point\">\r\n            	<ul>\r\n<li>Electricity (Generation, Distribution, Customer Service)</li>\r\n<li>Telecommunications</li>\r\n<li>Ports and ports related activities</li>\r\n<li>Logistic</li>\r\n<li>Health Care</li>\r\n                </ul>\r\n            </div>\r\n        </div>\r\n        \r\n        \r\n     \r\n    </div>','Industry Work','','publish','open','open','','industry-work','','','2015-08-24 08:22:25','2015-08-24 08:22:25','',0,'http://cmabhavsarassoc.in/?page_id=10',0,'page','',0),(11,1,'2015-07-16 10:11:02','2015-07-16 10:11:02','','Industry Work','','inherit','open','open','','10-revision-v1','','','2015-07-16 10:11:02','2015-07-16 10:11:02','',10,'http://cmabhavsarassoc.in/2015/07/16/10-revision-v1/',0,'revision','',0),(12,1,'2015-07-16 10:11:10','2015-07-16 10:11:10','<div class=\"updatessec\">\r\nWe are updating this section, please come back soon\r\n</div>','Updates','','publish','open','open','','updates','','','2015-08-24 08:12:11','2015-08-24 08:12:11','',0,'http://cmabhavsarassoc.in/?page_id=12',0,'page','',0),(13,1,'2015-07-16 10:11:10','2015-07-16 10:11:10','','Updates','','inherit','open','open','','12-revision-v1','','','2015-07-16 10:11:10','2015-07-16 10:11:10','',12,'http://cmabhavsarassoc.in/2015/07/16/12-revision-v1/',0,'revision','',0),(14,1,'2015-07-16 10:11:16','2015-07-16 10:11:16','<div class=\"contact-container\">\r\n\r\n<div class=\"detail\">\r\n\r\n<div class=\"contactinfo-box\">  \r\n<img src=\"http://cmabhavsarassoc.in/wp-content/themes/twentytwelve/img/location-icon.png\" />      	\r\n<h1>Our Location</h1>\r\n<p>D/916, Shiromani Complex, <br />Opp. Ocean Park, Satellite Road, <br />Nehrunagar, Ahmedabad  380 015</p>\r\n</div>\r\n\r\n<div class=\"contactinfo-box\">  \r\n<img src=\"http://cmabhavsarassoc.in/wp-content/themes/twentytwelve/img/location-icon.png\" />      	\r\n<h1>Our Branch</h1>\r\n<p>422, 4th Floor, RK Empire, <br />Nr. Mavdi Circle, 150 Feet Ring Road, Rajkot  360 004</p>\r\n</div>\r\n\r\n<div class=\"contactinfo-box\">\r\n<img src=\"http://cmabhavsarassoc.in/wp-content/themes/twentytwelve/img/contact-icon.png\" />\r\n<h1>Contact Us</h1>\r\n<p>(O) : 079-26768804 <br />(M) : +91 99241 28804 <br />(E) : ashish@cmabhavsarassoc.in</p>\r\n</div>\r\n\r\n<div class=\"contactinfo-box\">\r\n<img src=\"http://cmabhavsarassoc.in/wp-content/themes/twent