evelopment, preparation of cost records as per the companies act, cost audit of cost\r\nrecords as per the companies act etc.</li>\r\n	<li>He is actively associate with ICAI  Ahmedabad Chapter for last 10 years. He was treasurer of\r\nthe chapter from 2010-11 to 2012-13. He was also secretary of the chapter from 2013-14 to\r\n2013-15. Presently, He is vice  chairman of the chapter.</li>\r\n</ul>\r\n</div>\r\n</div>\r\n<div class=\"partner-2\">\r\n<div class=\"partnerimage\">\r\n<h1 class=\"partnertitle\">CMA Sagar Kapadiya</h1>\r\n</div>\r\n<div class=\"contain-box\">\r\n<ul>\r\n	<li>CMA Sagar Kapadiya is dynamic and young person aged about 25 years.</li>\r\n	<li>He has completed his Cost Accountancy in the year 2013 From the institute of Cost\r\nAccountants of India.</li>\r\n	<li>He has obtained his graduation degree in commerce stream from Gujarat University.</li>\r\n	<li>He has practical exposure in the field of Cost &amp; Management Accountancy relating to cost\r\nrecord, cost audit, Accounting, Finance, Income Tax &amp; Company Formation.</li>\r\n</ul>\r\n</div>\r\n</div>\r\n<div class=\"partner-3\">\r\n<div class=\"partnerimage\">\r\n<h1 class=\"partnertitle\">CMA Rajesh Vamja</h1>\r\n</div>\r\n<div class=\"contain-box\">\r\n<ul>\r\n	<li>CMA Rajesh Vamja is dynamic and young person aged about 25 years.</li>\r\n	<li>He has completed his Cost Accountancy in the year 2012 from the institute of Cost\r\nAccountants of India.</li>\r\n	<li>He has obtained his graduation degree in commerce stream from Gujarat University &amp;\r\nPost Graduation Degree in commerce stream from the IGNOU.</li>\r\n	<li>He is certified as a Tax Return Preparer (TRPs) by the income tax department &amp; NIIT in the\r\nyear 2012.</li>\r\n	<li>He has practical exposure in the field of cost &amp; management accountancy relating to cost\r\nrecord, cost audit &amp; MIS reporting.</li>\r\n</ul>\r\n</div>\r\n</div>\r\n</div>','Partner','','publish','open','open','','philosophy','','','2016-08-20 11