actor-authentication\\/\",\"order\":5},{\"title\":\"Firewall Learning Mode\",\"permalink\":\"https:\\/\\/www.wordfence.com\\/help\\/firewall\\/learning-mode\\/\",\"order\":6},{\"title\":\"Scan Results\",\"permalink\":\"https:\\/\\/www.wordfence.com\\/help\\/scan\\/scan-results\\/\",\"order\":7},{\"title\":\"I am locked out of my site\",\"permalink\":\"https:\\/\\/www.wordfence.com\\/help\\/blocking\\/#i-am-locked-out-of-my-site\",\"order\":8},{\"title\":\"PHP Fatal error: Failed opening required wordfence-waf.php\",\"permalink\":\"https:\\/\\/www.wordfence.com\\/help\\/firewall\\/#php-fatal-error-failed-opening-required-wordfence-waf-php\",\"order\":9}],\"all\":[{\"title\":\"Wordfence Free\",\"permalink\":\"https:\\/\\/www.wordfence.com\\/help\\/wordfence-free\\/\",\"excerpt\":\"Wordfence Free is an all-in-one security solution for WordPress websites that includes an endpoint firewall, security scanner, login security, alerts, centralized management, and more.\",\"order\":0},{\"title\":\"Wordfence Premium\",\"permalink\":\"https:\\/\\/www.wordfence.com\\/help\\/wordfence-premium\\/\",\"excerpt\":\"Wordfence Premium comes with real-time firewall protection, real-time scan signatures, an IP address blocklist, country blocking, and Premium support.\",\"order\":1},{\"title\":\"Wordfence Care\",\"permalink\":\"https:\\/\\/www.wordfence.com\\/help\\/wordfence-care\\/\",\"excerpt\":\"Wordfence Care is for business owners who place a premium on their time. Our team installs, configures, optimizes, and maintains your WordPress site security.\",\"order\":2},{\"title\":\"Wordfence Response\",\"permalink\":\"https:\\/\\/www.wordfence.com\\/help\\/wordfence-response\\/\",\"excerpt\":\"Wordfence Response is for mission-critical WordPress websites that require 24\\/7\\/365 security monitoring with a 1-hour response time and 24-hour remediation.\",\"order\":3},{\"title\":\"Incident Response Services\",\"permalink\":\"https:\\/\\/www.wordfence.com\\/help\\/incident-response-services\\/\",\"excerpt\":\"Let one of our Security Analysts help you clean your infected site or inspect it for vulnerabilities.\",\"order\":4},{\"title\":\"License Key\",\"permalink\":\"https:\\/\\/www.wordfence.com\\/help\\/api-key\\/\",\"excerpt\":\"All Wordfence installations need a license key, also known as an API-key. The key can be a free key or a Premium key. \",\"order\":5},{\"title\":\"Account and Billing History\",\"permalink\":\"https:\\/\\/www.wordfence.com\\/help\\/account\\/\",\"excerpt\":\"How to navigate and use your Wordfence account.\",\"order\":6},{\"title\":\"Wordfence Central\",\"permalink\":\"https:\\/\\/www.wordfence.com\\/help\\/central\\/\",\"excerpt\":\"Wordfence Central provides a powerful and efficient way to manage the security of many WordPress sites via a single interface.\",\"children\":[{\"title\":\"Connecting your sites to Wordfence Central\",\"permalink\":\"https:\\/\\/www.wordfence.com\\/help\\/central\\/connect\\/\",\"order\":0},{\"title\":\"Setting up two-factor authentication\",\"permalink\":\"https:\\/\\/www.wordfence.com\\/help\\/central\\/2fa\\/\",\"order\":1},{\"title\":\"Using the Dashboard page\",\"permalink\":\"https:\\/\\/www.wordfence.com\\/help\\/central\\/central\\/\",\"order\":2},{\"title\":\"Using the Configuration page\",\"permalink\":\"https:\\/\\/www.wordfence.com\\/help\\/central\\/configuration\\/\",\"order\":3},{\"title\":\"Using Wordfence plugin options Templates\",\"permalink\":\"https:\\/\\/www.wordfence.com\\/help\\/central\\/templates\\/\",\"order\":4},{\"title\":\"Using the Settings page\",\"permalink\":\"https:\\/\\/www.wordfence.com\\/help\\/central\\/settings\\/\",\"order\":5},{\"title\":\"Using Wordfence Central Teams\",\"permalink\":\"https:\\/\\/www.wordfence.com\\/help\\/central\\/teams\\/\",\"order\":6},{\"title\":\"Viewing scan Findings\",\"permalink\":\"https:\\/\\/www.wordfence.com\\/help\\/central\\/findings\\/\",\"order\":7}],\"order\":7},{\"title\":\"Dashboard\",\"permalink\":\"https:\\/\\/www.wordfence.com\\/help\\/dashboard\\/\",\"excerpt\":\"The Wordfence Dashboard provides insight into the current state of your sites security.\",\"children\":[{\"title\":\"Options\",\"permalink\":\"https:\\/\\/www.wordfence.com\\/help\\/dashboard\\/options\\/\",\"order\":0},{\"title\":\"Alerts\",\"permalink\":\"https:\\/\\/www.wordfence.com\\/help\\/dashboard\\/alerts\\/\",\"order\":1}],\"order\":8},{\"title\":\"Firewall\",\"permalink\":\"https:\\/\\/www.wordfence.com\\/help\\/firewall\\/\",\"excerpt\":\"The Wordfence Web Application Firewall is a PHP based, application level firewall that filters out malicious requests to your site. \",\"children\":[{\"title\":\"Optimizing\",\"permalink\":\"https:\\/\\/www.wordfence.com\\/help\\/firewall\\/optimizing-the-firewall\\/\",\"order\":0},{\"title\":\"Learning Mode\",\"permalink\":\"https:\\/\\/www.wordfence.com\\/help\\/firewall\\/learning-mode\\/\",\"order\":1},{\"title\":\"Statistics\",\"permalink\":\"https:\\/\\/www.wordfence.com\\/help\\/firewall\\/statistics\\/\",\"order\":2},{\"title\":\"Options\",\"permalink\":\"https:\\/\\/www.wordfence.com\\/help\\/firewall\\/options\\/\",\"order\":3},{\"title\":\"MySQLi storage engine\",\"permalink\":\"https:\\/\\/www.wordfence.com\\/help\\/firewall\\/mysqli-storage-engine\\/\",\"order\":4},{\"title\":\"Brute Force Protection\",\"permalink\":\"https:\\/\\/www.wordfence.com\\/help\\/firewall\\/brute-force\\/\",\"order\":5},{\"title\":\"Rate Limiting\",\"permalink\":\"https:\\/\\/www.wordfence.com\\/help\\/firewall\\/rate-limiting\\/\",\"order\":6},{\"title\":\"Troubleshooting\",\"permalink\":\"https:\\/\\/www.wordfence.com\\/help\\/firewall\\/troubleshooting\\/\",\"order\":7}],\"order\":9},{\"title\":\"Blocking\",\"permalink\":\"https:\\/\\/www.wordfence.com\\/help\\/blocking\\/\",\"excerpt\":\"Aside from the firewall rules that protect against various attacks, Wordfence also has custom features for additional blocking. \",\"children\":[{\"title\":\"Country Blocking\",\"permalink\":