INSERT INTO `wp_wfissues` (`id`, `time`, `lastUpdated`, `status`, `type`, `severity`, `ignoreP`, `ignoreC`, `shortMsg`, `longMsg`, `data`) VALUES (107,1679870486,1679870486,'new','skippedPaths',25,'6fd0d290b978eab8027e6b79501ac149','6fd0d290b978eab8027e6b79501ac149','1 path was skipped for the malware scan due to scan settings','The option \"Scan files outside your WordPress installation\" is off by default, which means 1 path and its file(s) will not be scanned for malware or unauthorized changes. To continue skipping this path, you may ignore this issue. Or to start scanning it, enable the option and subsequent scans will include it. Some paths may not be necessary to scan, so this is optional. <a href=\"https://www.wordfence.com/help/?query=scan-result-skipped-paths\" target=\"_blank\" rel=\"noopener noreferrer\">Learn More<span class=\"screen-reader-text\"> (opens in new tab)</span></a><br><br>The path skipped is /home/cmabhavsarassoc/public_html/beta','a:0:{}'),(113,1679870522,1679870522,'new','wfPluginAbandoned',50,'a17bbba102c768ec9ec847707ac1d985','a17bbba102c768ec9ec847707ac1d985','The Plugin \"Contact Form 7 Widget\" appears to be abandoned (updated September 27, 2009, tested to WP 2.8.4).','It was last updated 13 years 5 months ago and tested up to WordPress 2.8.4. Plugins can be removed from wordpress.org for various reasons. This can include benign issues like a plugin author discontinuing development or moving the plugin distribution to their own site, but some might also be due to security issues. In any case, future updates may or may not be available, so it is worth investigating the cause and deciding whether to temporarily or permanently replace or remove the plugin. <a href=\"https://www.wordfence.com/help/?query=scan-result-plugin-abandoned\" target=\"_blank\" rel=\"noopener noreferrer\">Get more information.<span class=\"screen-reader-text\"> (opens in new tab)</span></a>','a:18:{s:4:\"name\";s:21:\"Contact Form 7 Widget\";s:4:\"slug\";s:21:\"c